pragma solidity ^0.4.19;

contract TicTacToe {
    // The cost of playing the game
    uint constant public gameCost = 0.1 ether;

    // Board size - 3X3
    uint8 public boardSize = 3;

    // Number of moves made in the game
    uint8 movesCounter;

    // Flag whether game is active versus ot enought players or game is over
    bool gameActive;

    // Cells will hold address of the holder of the cells
    address[3][3] board;

    address public player1;
    address public player2;

    // Address of the players whose turn it is
    address activePlayer;

    // Amounts owed to each player
    // Used in case send fails and player need to withdraw funds
    uint balanceToWithdrawPlayer1;
    uint balanceToWithdrawPlayer2;

    // Deal with abandoned game - set max time per move
    uint constant timeToReact = 5 minutes;
    uint gameValidUntil;

    // Event when second player joins
    event PlayerJoined(address playerAddress);

    // Event when player has completed a move - emits address of next player
    event NextPlayer(address playerAddress);

    // Event when a winner is found
    event GameOverWithWin(address playerAddress);

    // Event when the game ends in a draw
    event GameOverWithDraw();

    // Event when a timeout is detected (e.g. emergency payout activiated)
    event GameTimeout();

    // Event when the game pays out
    event PayoutSuccess(address winner, uint amountInWei);

    constructor() public payable {
        player1 = msg.sender;
        require(msg.value == gameCost);
        gameValidUntil = now + timeToReact;
    }

    function getBalance() public view returns (uint) {
        return address(this).balance;
    }

    function joinGame() public payable {
        // Assure that no second player has joined - e.g. only two players
        assert(player2 == address(0));
        require(msg.value == gameCost);

        player2 = msg.sender;
        gameActive = true;
        emit PlayerJoined(player2);

        // "Randomize" who goes first
        if (block.number % 2 == 0) {
            activePlayer = player2;
        } else {
            activePlayer = player1;
        }

        emit NextPlayer(activePlayer);
        gameValidUntil = now + timeToReact;
    }

    function getBoard() public view returns(address[3][3]) {
        return board;
    }

    function setWinner(address player) private {
        gameActive = false;
        // emit event
        emit GameOverWithWin(player);
        // pay out to winner (transfer funds)
        uint amount = address(this).balance;
        if (player.send(amount) == true) {
            emit PayoutSuccess(player, amount);
        } else {
            if (player == player1) {
                balanceToWithdrawPlayer1 = amount;
            } else {
                balanceToWithdrawPlayer2 = amount;
            }
        }
    }

    function withdrawWin() public {
        if (msg.sender == player1) {
            require(balanceToWithdrawPlayer1 > 0);
            player1.transfer(balanceToWithdrawPlayer1);
            emit PayoutSuccess(player1, balanceToWithdrawPlayer1);
            balanceToWithdrawPlayer1 = 0;
        } else if (msg.sender == player2) {
            require(balanceToWithdrawPlayer2 > 0);
            player1.transfer(balanceToWithdrawPlayer2);
            emit PayoutSuccess(player1, balanceToWithdrawPlayer2);
            balanceToWithdrawPlayer2 = 0;
        }
    }

    function setDraw() private {
        gameActive = false;
        emit GameOverWithDraw();
        uint halfAmount = address(this).balance / 2;

        if (player1.send(halfAmount) == true) {
            emit PayoutSuccess(player1, halfAmount);
        } else {
            balanceToWithdrawPlayer1 = halfAmount;
        }

        if (player2.send(halfAmount) == true) {
            emit PayoutSuccess(player2, halfAmount);
        } else {
            balanceToWithdrawPlayer2 = halfAmount;
        }
    }

    function setStone(uint8 x, uint8 y) public {
        // Can't choose a cell that is already taken
        require(board[x][y] == address(0));

        // Assure the game hasn't expired
        require(gameValidUntil > now);

        // Game must be active in order to make a move
        assert(gameActive);

        // Can't choose cells outside the cell range
        assert(x < boardSize);
        assert(y < boardSize);
        // Player taking turn is the active Player
        require(msg.sender == activePlayer);

        board[x][y] = msg.sender;
        movesCounter++;
        gameValidUntil = now + timeToReact;

        // Check for winner - note this is a loop and must be careful of gas
        for (uint8 i = 0; i < boardSize;i++) {
            if (board[i][y] != activePlayer) {
                break;
            }
            if (i == boardSize - 1) {
                // Win
                setWinner(activePlayer);
                return; // prevent further execution
            }
        }

        for (i = 0; i < boardSize;i++) {
            if (board[x][i] != activePlayer) {
                break;
            }
            if (i == boardSize - 1) {
                // Win
                setWinner(activePlayer);
                return; // prevent further execution            }
        }
        }

        // Diagonals
        if (x == y) {
            for (i = 0; i < boardSize;i++) {
                if (board[i][i] != activePlayer) {
                    break;
                }
                if (i == boardSize - 1) {
                    // Win
                    setWinner(activePlayer);
                    return; // prevent further execution
                }
            }
        }

        if ((x + y) == (boardSize - 1)) {
            for (i = 0; i < boardSize;i++) {
                if (board[i][(boardSize - 1) - i] != activePlayer) {
                    break;
                }
                if (i == boardSize - 1) {
                    // Win
                    setWinner(activePlayer);
                    return; // prevent further execution
                }
            }

        }

        // Draw
        if (movesCounter == boardSize ** 2) {
            // Draw
            setDraw();
            return; // prevent further execution
        }

        // Switch to other Player's turn
        if (activePlayer == player1) {
            activePlayer = player2;
        } else {
            activePlayer = player1;
        }
        emit NextPlayer(activePlayer);
    }

    // Handle abandoned game - emergency cash out
    // Refund player's deposits
    function emergencyCashout() public {
        require(gameValidUntil < now);
        require(gameActive);
        emit GameTimeout();
        setDraw();
    }
}
